import logo from './icons/logo.svg';
import './App.css';

function Button({icon, text}) {
  return (
    <button className="my-button">
      {icon && <img src={icon} alt="button icon" className="button-icon" />}
      {text}
    </button>
  );
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <br />
        <Button icon="./icons/plane.svg" text="Click the button" />
        <p>
          This is a simple React application with a custom button component.
        </p>
        <p>
          The button includes an image and some text.
        </p>
      </header>
    </div>
  );
}

export default App;
